import {
  GET_MOVIES_ATTEMPT,
  GET_MOVIES_FAIL,
  GET_MOVIES_SUCCESS
} from './constants';

const initialState = {
  popularMovies: []
};

const listing = (state = initialState, action) => {
  if (action && action.type) {
    switch (action.type) {
      case GET_MOVIES_ATTEMPT:
        return {
          ...state
        }

      case GET_MOVIES_FAIL:
        return {
          ...state
        }

      case GET_MOVIES_SUCCESS:
        return {
          ...state,
          ...console.log(action.payload),
          popularMovies: action.payload.results
        }

      default: return state;
    }
  }
  return state;
};

export default listing;
